#include <bits/stdc++.h>
using namespace std;
#define faster() ios_base::sync_with_stdio(false);cin.tie();cout.tie();
#define matrix vector <vector<long long>>
#define MOD 1000000007
const long long big = 1e6;
vector <long long> res;

int main() {
    faster();
    int t;
    cin >> t;
    while ( t-- )
    {
        int n, d;
        cin >> n >> d;
        deque <int> a;
        for (int i = 0 ; i < n ; i++)
        {
            int x;
            cin >> x;
            a.push_back(x);
        }
        for (int i = 0 ; i < d ; i++)
        {
            a.push_back(a.front());
            a.pop_front();
        }
        for (int i = 0 ; i < n ; i++)
        {
            cout << a[i] << " ";
        }
        if ( t != 0 )
        {
            cout << endl;
        }
    }
}

